version: '3.8'
services:
  executor-000:
    image: executor-prebuilt
    command: python main.py
    ports:
    - 60000:8432
    environment:
    - PORT=8432
    - CONTAINER_ID=0
    - HOST_PORT=60000
    - PYTHONUNBUFFERED=1
    - PYTHONDONTWRITEBYTECODE=1
    - EXECUTION_TIMEOUT=600
    - WORKSPACE_FOLDER=/data
    restart: unless-stopped
    labels:
    - container.id=0
    - container.port=60000
    - container.type=executor-prebuilt
    mem_limit: 2G
    cpus: 0.5
    mem_reservation: 512M
    extra_hosts:
    - host.docker.internal:host-gateway
    volumes:
    - ../data/data:/data:ro
